import React from 'react'

import {
	TransactionContainer,
	HeaderContainer,
	TypeContainer,
	DateContainer,
	TableContainer,
	AmountContainer,
	TransferContainer
} from './transaction.styles';

const Transaction = () => {

    return (
        <TransactionContainer>
			<HeaderContainer>Transfer History</HeaderContainer>
			<TransferContainer>	
				<TableContainer>
					<TypeContainer>USD deposit via Bank Transfer</TypeContainer>
					<DateContainer>11-12-2300</DateContainer>
				</TableContainer>
				<AmountContainer>
					<TypeContainer>50000</TypeContainer>
				</AmountContainer>
			</TransferContainer>	
        </TransactionContainer>
)}


export default Transaction;
